import React from 'react';
import ReactDOM from 'react-dom';
import {add,mul,sub,div} from './Calc';

ReactDOM.render(
<>
<ul>
<li>Sum of two no is {add(30,3)}</li>
<li>Sub of two no is {mul(10,3)}</li>
<li>Div of two no isv{sub(30,3)}</li>
<li>Mult of two no is {div(10,3)}</li>
</ul>
</>,
document.getElementById('root')
);
